import React from 'react';
import { Route, Routes, BrowserRouter as Router } from 'react-router-dom';
import Navbar from './Components/Navbar/Navbar';
import Home from './Components/Home/Home';
import Courses from './Components/Courses/Courses';
import About from './Components/About/About';
import Contact from './Components/Contact/Contact';
import RegistrationForm from "./Components/RegistrationForm/RegistrationForm";
import SchoolInfoBox from "./Components/SchoolInfoBox/SchoolInfoBox";
import KnowledgeTest from "./Components/KnowledgeTest/KnowledgeTest";
import Price from "./Components/Price/Price";

const AppTest = () => {
    return (
        <Router>
            <Navbar />
            <RegistrationForm /> {/* Добавьте компонент формы в основное содержимое */}
            <SchoolInfoBox /> {/* Добавьте компонент SchoolInfoBox после RegistrationForm */}
            <KnowledgeTest />
            <Price />
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/courses" element={<Courses />} />
                <Route path="/about" element={<About />} />
                <Route path="/contact" element={<Contact />} />
            </Routes>
        </Router>

    );

};

export default AppTest;
